import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import "./imageSlider.css";
// import $ from "jquery";

const ImageSlider = () => {
  let settings = {
    dots: false,
    infinite: true,
    speed: 1000,
    slideToShow: 1,
    slideToScroll: 1,
    autoplay: true,
    arrows: false,
  };
  return (
    <div className="bg-white slider">
      <Slider {...settings} className="container slider mx-auto">
        <div className="image-container">
          <div className="info absolute bottom-5 left-5 text-red w-full md:w-1/2">
            <div className="title  text-3xl font-bold">title</div>
            <div className="story">
              Lorem ipsum dolor sit, amet consectetur adipisicing elit. Itaque
              odit saepe nostrum accusamus similique, officia ut sunt harum
              soluta fuga! Lorem ipsum, dolor sit amet consectetur adipisicing elit. Cum ullam, vitae modi esse sed asperiores dolore a vel aut! Qui.
            </div>
            <div className="footer">
              footer
            </div>
          </div>
          <div className="image">
            <a href="/">
              <img src="/assets/images/hxh.webp" alt="" />
            </a>
          </div>
        </div>
        
        
      </Slider>
      <div class="container">
        <div class="content">
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Ad est,
          doloremque aspernatur iste aut hic aperiam minima dolorem ipsum
          inventore vel. Repellendus ut dolore expedita eum voluptates, sapiente
          numquam est!
        </div>
        <div class="test">
          <img src="/assets/images/hxh.webp" alt="" />
        </div>
      </div>
    </div>
  );
};

export default ImageSlider;
